import React from 'react'
import s from './Dialogs.module.css';
import { NavLink } from 'react-router-dom';
import Message from './Message/Message';

const DialogItem = (props) => {
  let path = "/dialogs/" + props.id;
  return (

    <div className={s.dialog}>
      <NavLink to={path}>{props.name}</NavLink>
    </div>

  );
}

const Dialogs = () => {
  let dialogsData = [
    { id: 1, name: 'Dimych' },
    { id: 2, name: 'Dima' },
    { id: 3, name: 'Andrey' },
    { id: 4, name: 'Aman' },
    { id: 5, name: 'Esen' },
    { id: 6, name: 'Adilet' }
  ]

  let messagesData = [
    { id: 1, message: 'Hi' },
    { id: 2, message: 'How are you?' },
    { id: 3, message: 'yooo' },
    { id: 4, message: 'yooo' },
    { id: 5, namessageme: 'yooo' }
  ]

  let dialogElements = dialogsData.map(dialog => <DialogItem name={dialog.name} id={dialog.id} />);
  let messagesElements = messagesData.map(message => <Message message={messages.message} />);

  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        {dialogElements}
      </div>
      <div className={s.messages}>
        <Message message={messagesElements} />


      </div>

    </div>

  );

}
export default Dialogs
